import Navbar from "../components/Navbar";

export default function Home() {
  return (
    <div>
      {/* Navbar tetap di atas */}
      <Navbar />

      {/* Konten utama halaman */}
      <section className="px-6 py-10 bg-slate-50 min-h-screen">
        <div className="max-w-5xl mx-auto text-center">
          <h1 className="text-4xl font-bold text-giGreen mb-4">
            Selamat Datang di GiMultiLab
          </h1>
          <p className="text-lg text-gray-700">
            Platform digital untuk mendukung swasembada pangan melalui edukasi gizi, pangan lokal, dan UMKM Indonesia.
          </p>
        </div>
      </section>
    </div>
  );
}
